import React from 'react';
import {Menu} from 'semantic-ui-react';
export default ()=>{
    return (
        <Menu>
          <Menu.Item
            name='browse'
            active={activeItem === 'browse'}
            onClick={this.handleItemClick}
          >
            Browse
          </Menu.Item>


  
          <Menu.Menu position='right'>
            <Menu.Item
              name='signup'
              active={activeItem === 'signup'}
              onClick={this.handleItemClick}
            >
              campaigns
            </Menu.Item>
  
            <Menu.Item
              name='help'
              active={activeItem === 'help'}
              onClick={this.handleItemClick}
            >
              +
            </Menu.Item>
          </Menu.Menu>
        </Menu>
      )
}
